import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";
import Box, { BoxSort } from "../../molecules/Box";
import Span, { SpanWeight, SpanColor } from "../../atoms/Span";

const Comment = ({ commentLists }) => {
  return (
    <React.Fragment>
      {commentLists &&
        commentLists.map(
          (comment) => !comment.responseTo && <React.Fragment></React.Fragment>
        )}

      <Styled.CommentContainer>
        <Box sort={BoxSort.CENTER_SPACE_BETWEEN}>
          <Span weight={SpanWeight.L}>호호호잼누쿤</Span>
          <Span color={SpanColor.GRAY}>100/1000</Span>
        </Box>
        <textarea></textarea>
      </Styled.CommentContainer>
    </React.Fragment>
  );
};

Comment.propTypes = {
  commentLists: propTypes.array,
};

export default Comment;
